import './App.css';
import mainlogo from './Logo.png';
import Input from './Input';
import List from './List';
import React from 'react';

class App extends React.Component{
  constructor(props) {
    super(props);
    this.state = {submitted: false, results: null};
    this.changeSubmitState = this.changeSubmitState.bind(this)
    this.handleResults = this.handleResults.bind(this)
  }


  changeSubmitState() {
    this.setState({submitted: true})
  }

  handleResults(data){
    this.setState({results: data});
  }

  render(){
    return (
      <div>
        <img src={mainlogo} id="logo"/>
        <Input submitState={this.changeSubmitState} returnResults={this.handleResults}/>
        {this.state.submitted ? <List value={this.state.results}/> : <p> Please fill the form</p>}
      </div>
    );
  }



}


export default App;
